import React, { Component } from 'react';

export default class Header extends Component {
    render() {
        return (
            <header>
                <a href="#Home"><i className="fas fa-home fa-2x" id="FirstIcon" onmouseover="homeText()" onmouseout="blankText()"></i></a>
                <a href="#Me"><i className="fas fa-user-check fa-2x" id="SecondIcon" onmouseover="homeText()" onmouseout="blankText()"></i></a>
                <a href="#myWorks"><i className="fas fa-laptop-code fa-2x" id="ThirdIcon" onmouseover="homeText()" onmouseout="blankText()"></i></a>
                <a href="#mySocial"><i className="fas fa-handshake fa-2x" id="FourthIcon"></i></a>
                <article>
                    <h3 className="changingText" id="Change"></h3>
                </article>
            </header>

        );
    }
}
